import Header from './Header'; 
import signup from '../pages/signup';

const Layout = ({children})=>{

    return (
        <React.Fragment>
            <Header/>
            {children}
            <signup/>
            <p>Footer</p>
        </React.Fragment>
    )
}

export default Layout;
